.text

.global main
main:
movia r6, BLACK
 init_vga:

        /* We call a function!  Therefore, we can't rely on values not
	changing! */
        subi sp, sp, STACK_SIZE
        stw r16, 0(sp)
        stw r17, 4(sp)
        stw r18, 8(sp)
        stw r19, 12(sp)
        stw r20, 16(sp)
        stw ra, 20(sp)
  
  addi r16, r0, 0
  addi r17, r0, 0
  addi r18, r0, 0

        /* i < 160 */
          addi r19, r0, MAX_X
        /* j < 120 */
        addi r20, r0, MAX_Y
 loop:

        mov r4, r16
        mov r5, r17
        
  call put_pixel
        /* i++ */
  addi r16, r16, 1 
  addi r12, r12, 4  
  blt r16, r19, loop

        /* i = 0 */
  movi r16, 0
        /* j++ */
  addi r17, r17, 1
  blt r17, r20, loop
  
  end:
        ldw r16, 0(sp)
        ldw r17, 4(sp)
        ldw r18, 8(sp)
        ldw r19, 12(sp)
        ldw r20, 16(sp)
        ldw ra, 20(sp)
        addi sp, sp, STACK_SIZE

        




movia r11, arr
movia r3,0
movia r2,ADDR_VGA
		
		
		
		
       
	display_loop:
		ldw r10, 0(r11)
		
        stwio r10,0(r2)
		addi r11, r11, 4 
		addi r2, r2, 4 
		
		addi r3,r3,1
		movi r10, 19200
		bne r3, r10, display_loop	
		
		
		
		
movia r7, 0xff1060 /* r7 contains base address for LCD controller */
	movui r3, 71 /* ASCII code for G */
	stwio r3, 4(r7) /* Write the letter G */

	movui r3, 65 /* ASCII code for A */
	stwio r3, 4(r7) /* Write the letter A */

	movui r3, 77 /* ASCII code for M */
	stwio r3, 4(r7) /* Write the letter M */
	
	movui r3, 69 /* ASCII code for E */
	stwio r3, 4(r7) /* Write the letter E */
	
	movui r3, 32 /* ASCII code for "space" */
	stwio r3, 4(r7) /* Write "space" */
	
	movui r3, 79 /* ASCII code for O*/
	stwio r3, 4(r7) /* Write the letter O*/
	
	movui r3, 86 /* ASCII code for V */
	stwio r3, 4(r7) /* Write the letter V */
	
	movui r3, 69 /* ASCII code for E */
	stwio r3, 4(r7) /* Write the letter E */
	
	movui r3, 82 /* ASCII code for R */
	stwio r3, 4(r7) /* Write the letter R */
	
	movui r3, 33 /* ASCII code for "!" */
	stwio r3, 4(r7) /* Write "!" */
	
	movui r3, 33 /* ASCII code for "!" */
	stwio r3, 4(r7) /* Write "!" */
	
	movui r3, 33 /* ASCII code for "!" */
	stwio r3, 4(r7) /* Write "!" */
		
		
		
		
		
				
/*Now, light up the LEDs*/

	
	
	
	



  movia r2,ADDR_GREENLEDS
  movia r3,ADDR_REDLEDS
  
  movia r5,0xeeeeeeee   /* Turn on every 4th LED */
  movi  r6,0            /* Initialize counter to 0 */
LOOP_TWO:
  roli r5,r5,1    /* Rotate LEDs by 1 bit */
  stwio r5,0(r2)  /* Write to Green LEDs */
  stwio r5,0(r3)  /* Write to Red LEDs */

  stwio r6,0(r4)  /* Write to 7-segment displays */
  movia r7,0x10001
  add   r6,r6,r7
  
  movia r9,4000000
DELAY:
  subi r9,r9,1
  bne r9,r0, DELAY
  br LOOP_TWO


		

       